text:
iceland advert - banned (remake by kirapoems)
.
please share this with anyone and everyone. you’ll be surprised at the power you have when we work together. let’s get noticed!
.
we lose 25 orangutang every day due to deforestation. an area the size of a football pitch is torn down in indonesia’s rainforest every 25 seconds!! these rainforests are hotspots for biodiversity, and vital for regulating the earth’s climate. i say these words but to comprehend them is simply too much.
.
in the past decade, brands including nestle, unilever and mars have promised they would clean up the palm oil in their products by 2020 – but with less than two years to go, forest destruction in indonesia shows no signs of slowing down. that’s why we need to share things like this and put pressure on the big brands to make sure they put pressure on their suppliers.
.
palm oil is used in 50% of supermarket products including cosmetics – some of which we come across or use everyday like kit-kat, colgate toothpaste, johnson’s baby lotion,  dove’s soap, doritos, kellogg’s pop tarts, ritz crackers, m&m’s, head & shoulders shampoo, and many others! these companies buy their palm oil from wilmar – the dirtiest palm oil giant in the world – fuelling destruction, forest fires and human rights abuses across indonesia.
.
link for the official video and petition: https://secure.greenpeace.org.uk/page/s/rang-tan-video
.
music: vadim kiselev - alone in the dark
narrator: emma thompson (edited voice by kirapoems)
.
